const Navigation = ({ account, setAccount }) => {
    return(
        <nav>
            <ul>
                <li><a href='#'>Buy</a></li>
                <li><a href='#'>Rent</a></li>
                <li><a href='#'>Sell</a></li>
            </ul>
            <div className='nav_brand'>
                <img src={logo} alt='logo'/>
                <h1>Millow</h1>
            </div>

            <button type=''>

            </button>

        </nav>
    )
}

export default Navigation;
